INSERT INTO `vmf_content_modificator_activity` (`id`, `type`, `title`, `description`, `project`, `devise`, `icon`) VALUES (1,NULL,'EDUCATION','L\\\'éducation et l\\\'enseignement sont un puissant moteur de changement. Ils contribuent à la stabilité sociale et stimulent la croissance économique à long terme','Education civique;Réduction des taux d’analphabétisme;Augmentation du taux de scolarisation surtout au secondaire.;Renforcement de la capacité des femmes par des formations professionnelles;Amélioration de la qualité de l’éducation','L\\\'éducation et l\\\'enseignement sont les clés du développement durable.','school'),(2,NULL,'ENTREPRENEURIAT ET EMPLOI','La Fondation aidera les femmes à trouver du travail et à devenir des entrepreneurs. L\\\'entreprenariat est la source de croissance. Les petites et moyennes entreprises sont les vecteurs de cet entreprenariat. C\\\'est pourquoi la fondation aide, encourage et sensibilise les femmes à ouvrir leurs propres entreprises ou à ouvrir des entreprises de groupe compte tenu des opportunités qui existent dans le pays.','Renforcement de la capacité des femmes par le biais de formations;Créer des networks pour aider les femmes à trouver du travail;Les aider à créer leurs propres entreprises pour avoir des revenus supplémentaires. On leur donne les cannes à pêche et non le poisson.;Les inspirer de manière créative pour qu’elles puissent ouvrir leurs entreprises. Un soutien particulier est accordé au secteur de la transformation, ainsi qu’à l’agriculture','Je ne suis pas un fardeau pour la société','work'),(3,NULL,'SANTE','Le bien-être physique et mental est la clé de la productivité et de l\\\'efficacité dans le travail, dans les études, et dans tout ce qu’on fait.','Encourager les femmes à faire les bilans de santé réguliers. Le proverbe dit « vaut mieux prévenir que guérir ». Les bilans permettent de prévenir. Des exercices physiques, éducation nutritionnelle pour la santé,…seront au programme;Améliorer des équipements médicaux et de diagnostic;Ouverture des maternités et des services d’urgence;Avoir des spécialistes des professionnels de santé','Corps sains, esprits sains','local_hospital'),(4,'main','NOTRE VISION','Le mot \\\"reny\\\" se trouve au cœur du mot firenena ou nation. Ainsi, les mères occupent une place centrale au sein de la nation malagasy. Notre vision est  « Femmes Moteurs de Développement » FMD ou (VMF en malagasy), ce qui fait du VMF un mouvement de femmes génératrices d’évolution et de développement d’elles-mêmes et de leur pays.',NULL,NULL,'icon'),(8,NULL,'SOCIAL','Une société harmonieuse où les femmes peuvent s\\\'épanouir dans tous les aspects Il s\\\'agit d\\\'améliorer le bien-être de chaque femme dans la société afin qu\\\'elle puisse réaliser son plein potentiel. Le social a une dimension très large : les droits premiers des filles et des femmes, l\\\'équité, l\\\'environnement, etc. mais l\\\'objectif final est que les femmes progressent dans les voies de l\\\'autosuffisance et deviennent les moteurs de développement de Madagscar.','Développement durable;Echange culturel;Aider les personnes vulnérables;Centre de conseil et accompagnement','Une société harmonieuse où les femmes peuvent s\\\'épanouir dans tous les aspects','people');
