INSERT INTO `vmf_content_modificator_carousel` (`id`, `type`, `title`, `description`, `image`) VALUES (4,NULL,'JUSTICE','Justice décrit la peur de Dieu, la droiture dans les actes et pensées. Psaume 106 :3 « Heureux ceux qui observent la loi, Qui pratiquent la justice en tout temps »',NULL),(5,NULL,'BONTE','C’est la bonté intérieure et en action. Colossiens 3 :23 « Tout ce que vous faites, faites-le de bon cœur, comme pour le Seigneur et non pour les hommes »',NULL),(6,NULL,'COURAGE','Courage et persévérance jusqu’à l’atteinte de l’objectif fixé. 1 Corinthiens 9 :24 « Ne savez-vous pas que ceux qui courent dans le stade courent tous, mais qu’un seul remporte le prix ? Courez de manière à le remporter »',NULL),(8,'main',NULL,NULL,'https://www.vmf-mada.org/wp-content/uploads/2023/09/exe-JUPE-fleur-grappe-2022-HD1.jpg');
