INSERT INTO `vmf_content_modificator_event` (`id`, `id_activity`, `type`, `title`, `description`, `image`, `video`, `location`, `eventdate`) VALUES (2,0,'main','NOS EVENEMENTS','Les événements organisés par la Fondation VMF sont des occasions spéciales visant à mettre en œuvre des actions concrètes pour promouvoir l\\\'autonomisation des femmes malgaches et contribuer au développement de Madagascar. Ces événements peuvent prendre différentes formes et sont organisés dans le cadre des domaines d\\\'intervention de la fondation, tels que l\\\'éducation et la formation, l\\\'entrepreneuriat et l\\\'emploi, la santé et le bien-être, ainsi que les initiatives sociales.',NULL,NULL,NULL,NULL),(8,8,NULL,'0','Distribution de vêtements dans le quartier d\\\'Andavamamba à Antananarivo.','https://www.vmf-mada.org/wp-content/uploads/2023/08/Distribution-de-vetements-3.jpg,https://www.vmf-mada.org/wp-content/uploads/2023/08/Distribution-de-vetements.jpg,https://www.vmf-mada.org/wp-content/uploads/2023/08/Distribution-de-vetements-2.jpg,https://www.vmf-mada.org/wp-content/uploads/2023/09/Distribution-de-vetement-e1694243167573.jpg','http://localhost/vmf/wp-content/uploads/2023/08/The-Seven-Deadly-Sins-Opening-4-4K-60FPS-Creditless.mp4','Andavamamba','2023-02-22'),(9,3,NULL,'3','Don de sang à l\\\'Hôpital Joseph Ravoahangy Andrianavalona (HJRA) à Antananarivo.','https://www.vmf-mada.org/wp-content/uploads/2023/08/Don-de-sang.jpg,https://www.vmf-mada.org/wp-content/uploads/2023/08/Don-de-sang-3.jpg,https://www.vmf-mada.org/wp-content/uploads/2023/08/Don-de-sang-2.jpg','http://localhost/vmf/wp-content/uploads/2023/08/The-Seven-Deadly-Sins-Opening-4-4K-60FPS-Creditless.mp4','Hôpital HJRA','2020-12-11'),(10,1,NULL,'','Distribution de denrées alimentaires aux 4 mineurs détenus à l\\\'EEM Antanimora pour s’assurer de leurs nourritures pendant les 3 jours d’examen de BEPC','https://www.vmf-mada.org/wp-content/uploads/2023/08/EEM-Antanimora.jpg,https://www.vmf-mada.org/wp-content/uploads/2023/08/EEM-Antanimora-2.jpg','http://localhost/vmf/wp-content/uploads/2023/08/The-Seven-Deadly-Sins-Opening-4-4K-60FPS-Creditless.mp4','EEM Antanimora','2022-07-04'),(11,8,NULL,'','Reboisement à Commune Ambohijanaka','https://www.vmf-mada.org/wp-content/uploads/2023/08/Reboisement-3.jpg,https://www.vmf-mada.org/wp-content/uploads/2023/08/Reboisement-4.jpg,https://www.vmf-mada.org/wp-content/uploads/2023/08/Reboisement.jpg,https://www.vmf-mada.org/wp-content/uploads/2023/08/Reboisement-2.jpg','http://localhost/vmf/wp-content/uploads/2023/08/The-Seven-Deadly-Sins-Opening-4-4K-60FPS-Creditless.mp4','Ambohijanaka','2021-03-08'),(12,2,NULL,'','La VMF a pu donner un travail temporaire de collecte de données primaires sur les indicateurs liés aux domaines de l\\\'IDSP- BAD. 50 Enquêteurs se sont mobilisés.','https://www.vmf-mada.org/wp-content/uploads/2023/08/Enquete-BAD-3.jpeg,https://www.vmf-mada.org/wp-content/uploads/2023/08/Enquete-BAD.jpeg','http://localhost/vmf/wp-content/uploads/2023/08/The-Seven-Deadly-Sins-Opening-4-4K-60FPS-Creditless.mp4','Mahaiza - Betafo','2023-05-01');
