 - Femmes Moteurs de Développement est une fondation dédiée à l\'autonomisation des femmes malgaches. Fondée pendant le confinement de 2020, notre mission est d\'inspirer et de soutenir les femmes à devenir des actrices du développement économique, social et personnel. À travers des initiatives telles que l\'éducation, l\'entrepreneuriat, la santé et le social, nous travaillons à renforcer les femmes pour qu\'elles deviennent des forces motrices de changement positif dans leurs familles et leurs communautés. Rejoignez-nous dans notre vision de justice, de bonté et de courage pour un Madagascar prospère et équilibré. Ensemble, nous sommes les Femmes Moteurs de Développement.'),(121,7,'_yoast_wpseo_focuskw','VMF Femmes Moteurs de Développement Madagascar - Vehivavy Môteran\'ny Fampandrosoana - Fondation pour l\'autonomisation des femmes malgaches - A propos'),(122,7,'_yoast_wpseo_linkdex','22'),(123,7,'_yoast_wpseo_opengraph-title','%%title%% %%page%% %%sep%% %%sitename%%'),(124,7,'_yoast_wpseo_opengraph-description','VMF - Femmes Moteurs de Développement est une fondation dédiée à l\'autonomisation des femmes malgaches. Fondée pendant le confinement de 2020, notre mission est d\'inspirer et de soutenir les femmes à devenir des actrices du développement économique, social et personnel. À travers des initiatives telles que l\'éducation, l\'entrepreneuriat, la santé et le social, nous travaillons à renforcer les femmes pour qu\'elles deviennent des forces motrices de changement positif dans leurs familles et leurs communautés. Rejoignez-nous dans notre vision de justice, de bonté et de courage pour un Madagascar prospère et équilibré. Ensemble, nous sommes les Femmes Moteurs de Développement.'),(125,7,'_yoast_wpseo_opengraph-image','https://vmf-mada.org/wp-content/uploads/2023/08/Don-de-sang.jpg'),(126,7,'_yoast_wpseo_opengraph-image-id','32'),(127,7,'_yoast_wpseo_twitter-title','%%title%% %%page%% %%sep%% %%sitename%%'),(128,7,'_yoast_wpseo_twitter-description','VMF - 